  const [token, setToken] = useState("")

  return (
    <TokenContext.Provider value={{token, setToken}}>
    <div className="App">
        <Navbar/>
        {/* Main content start */}
        <Outlet />
        {/* Main content end */}
        <Footer/>
    </div>
    </TokenContext.Provider>
  );
}

export default App;
